const stylee = ({ ID }) => {
    if (ID === 3) {
      return {
        color: "#FFFFF",
        textAlign: "center",
        fontFamily: "Poppins",
        fontSize: "16px",
        fontStyle: "normal",
        fontWeight: "500",
        lineHeight: "32px",
      };
    } else {
      return {};
    }
  };
  
  export default stylee;
